import React from 'react';
import axios from 'axios';


import './App.css';

class App extends React.Component{


  constructor(){
    super()

    this.state={
      dt:[]
    }
  }

  call=()=>{
    var b=[]
   // var self=this
    axios.get('http://localhost:5000/data')
    .then( (response) =>{
      // handle success
      var a=JSON.stringify(response)

      b=a.split(" ")


      console.log(b);
      this.setState({ dt:4})

    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .finally(function () {
      // always executed
    });


  }


  render(){
    return (
      <div>
        <button onClick={()=>this.call()}>submit</button>

        {
          this.state.dt.map(data=>{
            return <p>{data}</p>
          }
          )
        }
      </div>
    )
  }
}
export default App;
